import React, { useState } from "react";
import Card from "./Card"
import OperationBox from "./OperationBox";
import Parenthesis from "./Parenthesis";

import { Draggable, Droppable, DragDropContext } from "react-beautiful-dnd";

function App() {
    const [operation, setOperation] = useState("");
    const [isActive, setIsActive] = useState([true, false, false]);
    const [boxes, setBoxes] = useState([
        {
            id: "Card-1",
            number: 5,
            order:1
        },
        {
            id: "Card-2",
            number: 7,
            order:2
        },
        {
            id: "Card-3",
            number: 10,
            order:1
        },
        {
            id: "Card-4",
            number: 9,
            order:1
        }

    ])
    function arithmetics(event) {
        const x = event.target.value;
        const y = event.target.id;
        if (isActive) {
            setOperation(x);
        }
    }

    function findItem(id) {
        handleClick(id);
    }

    function handleClick(id) {
        setIsActive(current => !current)
    };

 const swapBoxes = (fromBox, toBox) => {
    console.log(fromBox);
    console.log(toBox);
        let fromIndex = -1;
        let toIndex = -1;

        for (let i = 0; i < boxes.length; i++) {
          if (boxes[i].id === fromBox.id) {
            fromIndex = i;
          }
          if (boxes[i].id === toBox.id) {
            toIndex = i;
          }
        }

        if (fromIndex != -1 && toIndex != -1) {
          let { fromId, ...fromRest } = boxes[fromIndex];
          let { toId, ...toRest } = boxes[toIndex];
          boxes[fromIndex] = { id: fromBox.id, ...toRest };
          boxes[toIndex] = { id: toBox.id, ...fromRest };

          this.setState({ boxes: boxes });
        }
      };
   const handleDragStart = data => event => {
        let fromBox = JSON.stringify({ id: data.id });
        console.log(fromBox)
        event.dataTransfer.setData("dragContent", fromBox);
        swapBoxes(fromBox,)
      };

    const  handleDragOver = data => event => {
        event.preventDefault(); // Necessary. Allows us to drop.
        return false;
      };

     const handleDrop = data => event => {
        event.preventDefault();

        let fromBox = JSON.parse(event.dataTransfer.getData("dragContent"));
        let toBox = { id: data.id };
        let tmp = document.createElement('span');
        tmp.className='hide';

        //swapBoxes(fromBox, toBox);

        return false;
      };

    return (

            <div>
                <h1>This is 24</h1>

                <div className="height">
                    <Parenthesis text="(" />
                    <Card number={boxes[0].number} id = {1} draggable = {"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop ={handleDrop} /> 
                    <OperationBox boolean={isActive} onChecked={findItem} text={operation} id={1} />
                    <Parenthesis text="(" />
                    <Card number={boxes[1].number} id = {2} draggable = {"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop ={handleDrop}/>
                    <Parenthesis text=")" />
                    <OperationBox boolean={isActive} onChecked={findItem} text={operation} id={2} />
                    <Parenthesis text="(" />
                    <Card number={boxes[2].number} id = {3} draggable = {"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop ={handleDrop}/>
                    <Parenthesis text=")" />
                    <OperationBox boolean={isActive} onChecked={findItem} text={operation} id={3} />
                    <Card number={boxes[3].number} id = {4} draggable = {"true"} onDragStart={handleDragStart} onDragOver={handleDragOver} onDrop ={handleDrop}/>
                    <Parenthesis text=")" />
                </div>
                <br />
                <br />
                <div>
                    <button onClick={arithmetics} className='arith' value="*">*</button>
                    <button onClick={arithmetics} className='arith' value="/">/</button>
                    <button onClick={arithmetics} className='arith' value="+">+</button>
                    <button onClick={arithmetics} className='arith' value="-">-</button>
                </div>
                <br />
                {/*             <DndProvider backend={HTML5Backend}>
             <Box /> 
            </DndProvider> */}


            </div>

    );
}

export default App;
